import React, { useEffect, useState } from 'react';

const Cosmetics = () => {

    const [cosmetics, setCosmetics] = useState([])

    useEffect(()=>{
        fetch('data.json')
        .then(res=>res.json())
        .then(data => setCosmetics(data))
    },[])

    return (
        <div>
            <h1>Hello</h1>
            <h2>{cosmetics.id}</h2>
        </div>
    );
};

export default Cosmetics;
